import (
	"database/sql"
	"encoding/json"
	"fmt"
	"html/template"
	"log"
	"net/http"
	"strconv"
	"time"

	"github.com/gorilla/mux"
	_ "github.com/mattn/go-sqlite3"
)

type Habit struct {
	ID              int       `json:"id"`
	Name            string    `json:"name"`
	Description     string    `json:"description"`
	WeeklyFrequency int       `json:"weekly_frequency"`
	Category        string    `json:"category"`
	CreatedAt       time.Time `json:"created_at"`
	IsActive        bool      `json:"is_active"`
}

type HabitCompletion struct {
	ID          int       `json:"id"`
	HabitID     int       `json:"habit_id"`
	CompletedAt time.Time `json:"completed_at"`
	Notes       string    `json:"notes"`
}

type HabitStats struct {
	Habit           Habit `json:"habit"`
	CurrentStreak   int   `json:"current_streak"`
	LongestStreak   int   `json:"longest_streak"`
	WeeklyProgress  int   `json:"weekly_progress"`
	TotalCompleted  int   `json:"total_completed"`
}

type App struct {
	DB *sql.DB
}

func main() {
	app := &App{}

	// Initialize database
	var err error
	app.DB, err = sql.Open("sqlite3", "./habits.db")
	if err != nil {
		log.Fatal(err)
	}
	defer app.DB.Close()

	// Create tables
	app.createTables()

	// Setup routes
	r := mux.NewRouter()

	// Web UI routes
	r.HandleFunc("/", app.homeHandler).Methods("GET")
	r.HandleFunc("/habits", app.habitsPageHandler).Methods("GET")
	r.HandleFunc("/stats", app.statsPageHandler).Methods("GET")

	// API routes
	r.HandleFunc("/api/habits", app.getHabitsHandler).Methods("GET")
	r.HandleFunc("/api/habits", app.createHabitHandler).Methods("POST")
	r.HandleFunc("/api/habits/{id}", app.updateHabitHandler).Methods("PUT")
	r.HandleFunc("/api/habits/{id}", app.deleteHabitHandler).Methods("DELETE")
	r.HandleFunc("/api/habits/{id}/complete", app.completeHabitHandler).Methods("POST")
	r.HandleFunc("/api/habits/{id}/completions", app.getCompletionsHandler).Methods("GET")
	r.HandleFunc("/api/stats", app.getStatsHandler).Methods("GET")

	// Static files
	r.PathPrefix("/static/").Handler(http.StripPrefix("/static/", http.FileServer(http.Dir("./static/"))))

	fmt.Println("Server starting on :8080")
	log.Fatal(http.ListenAndServe(":8080", r))
}

func (app *App) createTables() {
	habitsTable := `
	CREATE TABLE IF NOT EXISTS habits (
		id INTEGER PRIMARY KEY AUTOINCREMENT,
		name TEXT NOT NULL,
		description TEXT,
		weekly_frequency INTEGER NOT NULL DEFAULT 1,
		category TEXT DEFAULT 'General',
		created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
		is_active BOOLEAN DEFAULT 1
	);`

	completionsTable := `
	CREATE TABLE IF NOT EXISTS habit_completions (
		id INTEGER PRIMARY KEY AUTOINCREMENT,
		habit_id INTEGER NOT NULL,
		completed_at DATETIME DEFAULT CURRENT_TIMESTAMP,
		notes TEXT,
		FOREIGN KEY (habit_id) REFERENCES habits (id)
	);`

	_, err := app.DB.Exec(habitsTable)
	if err != nil {
		log.Fatal(err)
	}

	_, err = app.DB.Exec(completionsTable)
	if err != nil {
		log.Fatal(err)
	}
}

// Web UI Handlers
func (app *App) homeHandler(w http.ResponseWriter, r *http.Request) {
	tmpl := template.Must(template.ParseFiles("templates/index.html"))
	tmpl.Execute(w, nil)
}

func (app *App) habitsPageHandler(w http.ResponseWriter, r *http.Request) {
	tmpl := template.Must(template.ParseFiles("templates/habits.html"))
	tmpl.Execute(w, nil)
}

func (app *App) statsPageHandler(w http.ResponseWriter, r *http.Request) {
	tmpl := template.Must(template.ParseFiles("templates/stats.html"))
	tmpl.Execute(w, nil)
}

// API Handlers
func (app *App) getHabitsHandler(w http.ResponseWriter, r *http.Request) {
	rows, err := app.DB.Query(`
		SELECT id, name, description, weekly_frequency, category, created_at, is_active 
		FROM habits WHERE is_active = 1 ORDER BY created_at DESC
	`)
	if err != nil {
		http.Error(w, err.Error(), http.StatusInternalServerError)
		return
	}
	defer rows.Close()

	var habits []Habit
	for rows.Next() {
		var h Habit
		err := rows.Scan(&h.ID, &h.Name, &h.Description, &h.WeeklyFrequency, &h.Category, &h.CreatedAt, &h.IsActive)
		if err != nil {
			http.Error(w, err.Error(), http.StatusInternalServerError)
			return
		}
		habits = append(habits, h)
	}

	w.Header().Set("Content-Type", "application/json")
	json.NewEncoder(w).Encode(habits)
}

func (app *App) createHabitHandler(w http.ResponseWriter, r *http.Request) {
	var h Habit
	if err := json.NewDecoder(r.Body).Decode(&h); err != nil {
		http.Error(w, err.Error(), http.StatusBadRequest)
		return
	}

	result, err := app.DB.Exec(`
		INSERT INTO habits (name, description, weekly_frequency, category) 
		VALUES (?, ?, ?, ?)
	`, h.Name, h.Description, h.WeeklyFrequency, h.Category)

	if err != nil {
		http.Error(w, err.Error(), http.StatusInternalServerError)
		return
	}

	id, _ := result.LastInsertId()
	h.ID = int(id)
	h.CreatedAt = time.Now()
	h.IsActive = true

	w.Header().Set("Content-Type", "application/json")
	json.NewEncoder(w).Encode(h)
}

func (app *App) updateHabitHandler(w http.ResponseWriter, r *http.Request) {
	vars := mux.Vars(r)
	id, err := strconv.Atoi(vars["id"])
	if err != nil {
		http.Error(w, "Invalid habit ID", http.StatusBadRequest)
		return
	}

	var h Habit
	if err := json.NewDecoder(r.Body).Decode(&h); err != nil {
		http.Error(w, err.Error(), http.StatusBadRequest)
		return
	}

	_, err = app.DB.Exec(`
		UPDATE habits SET name = ?, description = ?, weekly_frequency = ?, category = ? 
		WHERE id = ?
	`, h.Name, h.Description, h.WeeklyFrequency, h.Category, id)

	if err != nil {
		http.Error(w, err.Error(), http.StatusInternalServerError)
		return
	}

	h.ID = id
	w.Header().Set("Content-Type", "application/json")
	json.NewEncoder(w).Encode(h)
}

func (app *App) deleteHabitHandler(w http.ResponseWriter, r *http.Request) {
	vars := mux.Vars(r)
	id, err := strconv.Atoi(vars["id"])
	if err != nil {
		http.Error(w, "Invalid habit ID", http.StatusBadRequest)
		return
	}

