		return
	}

	w.WriteHeader(http.StatusNoContent)
}

func (app *App) completeHabitHandler(w http.ResponseWriter, r *http.Request) {
	vars := mux.Vars(r)
	habitID, err := strconv.Atoi(vars["id"])
	if err != nil {
		http.Error(w, "Invalid habit ID", http.StatusBadRequest)
		return
	}

	var completion HabitCompletion
	if err := json.NewDecoder(r.Body).Decode(&completion); err != nil {
		completion.Notes = ""
	}

	result, err := app.DB.Exec(`
		INSERT INTO habit_completions (habit_id, notes) VALUES (?, ?)
	`, habitID, completion.Notes)

	if err != nil {
		http.Error(w, err.Error(), http.StatusInternalServerError)
		return
	}

	id, _ := result.LastInsertId()
	completion.ID = int(id)
	completion.HabitID = habitID
	completion.CompletedAt = time.Now()

