	json.NewEncoder(w).Encode(completion)
}

func (app *App) getCompletionsHandler(w http.ResponseWriter, r *http.Request) {
	vars := mux.Vars(r)
	habitID, err := strconv.Atoi(vars["id"])
	if err != nil {
		http.Error(w, "Invalid habit ID", http.StatusBadRequest)
		return
	}

	rows, err := app.DB.Query(`
		SELECT id, habit_id, completed_at, notes 
		FROM habit_completions 
		WHERE habit_id = ? 
		ORDER BY completed_at DESC
	`, habitID)
	if err != nil {
		http.Error(w, err.Error(), http.StatusInternalServerError)
		return
	}
	defer rows.Close()

	var completions []HabitCompletion
	for rows.Next() {
		var c HabitCompletion
		err := rows.Scan(&c.ID, &c.HabitID, &c.CompletedAt, &c.Notes)
		if err != nil {
			http.Error(w, err.Error(), http.StatusInternalServerError)
			return
		}
		completions = append(completions, c)
	}

	w.Header().Set("Content-Type", "application/json")
	json.NewEncoder(w).Encode(completions)
}

func (app *App) getStatsHandler(w http.ResponseWriter, r *http.Request) {
	rows, err := app.DB.Query(`
		SELECT h.id, h.name, h.description, h.weekly_frequency, h.category, h.created_at, h.is_active
		FROM habits h WHERE h.is_active = 1
	`)
	if err != nil {
		http.Error(w, err.Error(), http.StatusInternalServerError)
		return
	}
	defer rows.Close()

	var stats []HabitStats
	for rows.Next() {
		var h Habit
		err := rows.Scan(&h.ID, &h.Name, &h.Description, &h.WeeklyFrequency, &h.Category, &h.CreatedAt, &h.IsActive)
		if err != nil {
			http.Error(w, err.Error(), http.StatusInternalServerError)
			return
		}

		stat := HabitStats{
			Habit: h,
		}

		// Calculate total completions
		err = app.DB.QueryRow("SELECT COUNT(*) FROM habit_completions WHERE habit_id = ?", h.ID).Scan(&stat.TotalCompleted)
		if err != nil {
			stat.TotalCompleted = 0
		}

		// Calculate weekly progress
		weekStart := time.Now().AddDate(0, 0, -int(time.Now().Weekday()))
		weekStart = time.Date(weekStart.Year(), weekStart.Month(), weekStart.Day(), 0, 0, 0, 0, weekStart.Location())

		err = app.DB.QueryRow(`
			SELECT COUNT(*) FROM habit_completions 
			WHERE habit_id = ? AND completed_at >= ?
		`, h.ID, weekStart).Scan(&stat.WeeklyProgress)
		if err != nil {
			stat.WeeklyProgress = 0
		}

		// Calculate current streak
		stat.CurrentStreak = app.calculateCurrentStreak(h.ID)
		stat.LongestStreak = app.calculateLongestStreak(h.ID)

		stats = append(stats, stat)
	}

	w.Header().Set("Content-Type", "application/json")
	json.NewEncoder(w).Encode(stats)
}

func (app *App) calculateCurrentStreak(habitID int) int {
	rows, err := app.DB.Query(`
		SELECT DATE(completed_at) as completion_date
		FROM habit_completions 
		WHERE habit_id = ? 
		GROUP BY DATE(completed_at)
		ORDER BY completion_date DESC
	`, habitID)
	if err != nil {
		return 0
	}
	defer rows.Close()

	streak := 0
	expectedDate := time.Now().Format("2006-01-02")

	for rows.Next() {
		var completionDate string
		rows.Scan(&completionDate)

		if completionDate == expectedDate {
			streak++
			// Move to previous day
			date, _ := time.Parse("2006-01-02", expectedDate)
			expectedDate = date.AddDate(0, 0, -1).Format("2006-01-02")
		} else {
			break
		}
	}

	return streak
}

func (app *App) calculateLongestStreak(habitID int) int {
	rows, err := app.DB.Query(`
		SELECT DATE(completed_at) as completion_date
		FROM habit_completions 
		WHERE habit_id = ? 
		GROUP BY DATE(completed_at)
		ORDER BY completion_date ASC
	`, habitID)
	if err != nil {
		return 0
	}
	defer rows.Close()

	maxStreak := 0
	currentStreak := 0
	var lastDate time.Time

	for rows.Next() {
		var completionDate string
		rows.Scan(&completionDate)

		date, _ := time.Parse("2006-01-02", completionDate)

		if lastDate.IsZero() || date.Sub(lastDate).Hours() == 24 {
			currentStreak++
		} else {
			if currentStreak > maxStreak {
				maxStreak = currentStreak
			}
			currentStreak = 1
		}

		lastDate = date
	}

	if currentStreak > maxStreak {
		maxStreak = currentStreak
	}

	return maxStreak
