                const height = completions * 20;

                bar.innerHTML = `
                    <div class="bar-fill" style="height: ${height}px"></div>
                    <div class="bar-label">${day}</div>
                    <div class="bar-value">${completions}</div>
                `;
                chartContainer.appendChild(bar);
            });

            container.appendChild(chartContainer);
        }

        function displayAchievements(stats) {
            const container = document.getElementById('achievements');
            container.innerHTML = '';

            const achievements = generateAchievements(stats);

            if (achievements.length === 0) {
                container.innerHTML = '<div class="empty-state"><p>Complete some habits to unlock achievements!</p></div>';
                return;
            }

            achievements.forEach(achievement => {
                const achievementCard = document.createElement('div');
                achievementCard.className = `achievement-card ${achievement.unlocked ? 'unlocked' : 'locked'}`;
                achievementCard.innerHTML = `
                    <div class="achievement-icon">${achievement.icon}</div>
                    <div class="achievement-info">
                        <h4>${achievement.name}</h4>
                        <p>${achievement.description}</p>
                        ${achievement.unlocked ? '<span class="achievement-status">✅ Unlocked</span>' : '<span class="achievement-status">🔒 Locked</span>'}
                    </div>
                `;
                container.appendChild(achievementCard);
            });
        }

        function generateAchievements(stats) {
            const achievements = [];

            // Calculate totals
            const totalCompletions = stats.reduce((sum, stat) => sum + stat.total_completed, 0);
            const maxStreak = Math.max(...stats.map(stat => stat.longest_streak), 0);
            const activeStreaks = stats.filter(stat => stat.current_streak > 0).length;

            // First Steps
            achievements.push({
                name: "First Steps",
                description: "Complete your first habit",
                icon: "👶",
                unlocked: totalCompletions >= 1
            });

            // Getting Started
            achievements.push({
                name: "Getting Started",
                description: "Complete 10 habits",
                icon: "🚀",
                unlocked: totalCompletions >= 10
            });

            // Consistency
            achievements.push({
                name: "Consistency",
                description: "Maintain a 7-day streak",
                icon: "🔥",
                unlocked: maxStreak >= 7
            });

            // Dedication
            achievements.push({
                name: "Dedication",
                description: "Maintain a 30-day streak",
                icon: "💪",
                unlocked: maxStreak >= 30
            });

            // Multi-tasker
            achievements.push({
                name: "Multi-tasker",
                description: "Have 3 active streaks at once",
                icon: "🎯",
                unlocked: activeStreaks >= 3
            });

            // Century Club
            achievements.push({
                name: "Century Club",
                description: "Complete 100 habits",
                icon: "💯",
                unlocked: totalCompletions >= 100
            });

            return achievements;
        }
    </script>
