// Notification system
function showNotification(message, type = 'success') {
    // Remove existing notifications
    const existingNotifications = document.querySelectorAll('.notification');
    existingNotifications.forEach(notification => notification.remove());

    // Create new notification
    const notification = document.createElement('div');
    notification.className = `notification ${type}`;
    notification.textContent = message;

    document.body.appendChild(notification);

    // Auto-remove after 3 seconds
    setTimeout(() => {
        if (notification.parentNode) {
            notification.remove();
        }
    }, 3000);
}

// Format date helper
function formatDate(dateString) {
    const date = new Date(dateString);
    return date.toLocaleDateString('en-US', {
        year: 'numeric',
        month: 'short',
        day: 'numeric'
    });
}

// Format time helper
function formatTime(dateString) {
    const date = new Date(dateString);
    return date.toLocaleTimeString('en-US', {
        hour: '2-digit',
        minute: '2-digit'
    });
}

// Calculate days between dates
function daysBetween(date1, date2) {
    const oneDay = 24 * 60 * 60 * 1000;
    const firstDate = new Date(date1);
    const secondDate = new Date(date2);

    return Math.round(Math.abs((firstDate - secondDate) / oneDay));
}

// Get week start date (Monday)
function getWeekStart(date = new Date()) {
    const d = new Date(date);
    const day = d.getDay();
    const diff = d.getDate() - day + (day === 0 ? -6 : 1); // Adjust when day is Sunday
    return new Date(d.setDate(diff));
}

// Get week end date (Sunday)
function getWeekEnd(date = new Date()) {
    const weekStart = getWeekStart(date);
    const weekEnd = new Date(weekStart);
    weekEnd.setDate(weekStart.getDate() + 6);
    return weekEnd;
}

// Check if date is today
function isToday(date) {
    const today = new Date();
    const checkDate = new Date(date);

    return checkDate.getDate() === today.getDate() &&
           checkDate.getMonth() === today.getMonth() &&
           checkDate.getFullYear() === today.getFullYear();
}

// Check if date is this week
function isThisWeek(date) {
    const weekStart = getWeekStart();
    const weekEnd = getWeekEnd();
    const checkDate = new Date(date);

    return checkDate >= weekStart && checkDate <= weekEnd;
}

// Debounce function for search/input
function debounce(func, wait) {
    let timeout;
    return function executedFunction(...args) {
        const later = () => {
            clearTimeout(timeout);
            func(...args);
        };
        clearTimeout(timeout);
        timeout = setTimeout(later, wait);
    };
}

// Local storage helpers
const storage = {
    get: (key) => {
        try {
            const item = localStorage.getItem(key);
            return item ? JSON.parse(item) : null;
        } catch (error) {
            console.error('Error reading from localStorage:', error);
            return null;
        }
    },

    set: (key, value) => {
        try {
            localStorage.setItem(key, JSON.stringify(value));
            return true;
        } catch (error) {
            console.error('Error writing to localStorage:', error);
            return false;
        }
    },

    remove: (key) => {
        try {
            localStorage.removeItem(key);
            return true;
        } catch (error) {
            console.error('Error removing from localStorage:', error);
            return false;
        }
    }
};

// API helper functions
const api = {
    // Generic fetch wrapper
    request: async (url, options = {}) => {
        const defaultOptions = {
            headers: {
                'Content-Type': 'application/json',
            },
        };

        const config = { ...defaultOptions, ...options };

        try {
            const response = await fetch(url, config);

            if (!response.ok) {
                throw new Error(`HTTP error! status: ${response.status}`);
            }

            // Handle empty responses (like DELETE requests)
            if (response.status === 204) {
                return null;
            }

            return await response.json();
        } catch (error) {
            console.error('API request failed:', error);
            throw error;
        }
    },

    // GET request
    get: (url) => api.request(url),

    // POST request
    post: (url, data) => api.request(url, {
        method: 'POST',
        body: JSON.stringify(data)
    }),

    // PUT request
    put: (url, data) => api.request(url, {
        method: 'PUT',
        body: JSON.stringify(data)
    }),

    // DELETE request
    delete: (url) => api.request(url, {
        method: 'DELETE'
    })
};

// Habit-specific API functions
const habitAPI = {
    // Get all habits
    getHabits: () => api.get('/api/habits'),

    // Create a new habit
    createHabit: (habitData) => api.post('/api/habits', habitData),

    // Update a habit
    updateHabit: (id, habitData) => api.put(`/api/habits/${id}`, habitData),

    // Delete a habit
    deleteHabit: (id) => api.delete(`/api/habits/${id}`),

    // Complete a habit
    completeHabit: (id, notes = '') => api.post(`/api/habits/${id}/complete`, { notes }),

    // Get habit completions
    getCompletions: (id) => api.get(`/api/habits/${id}/completions`),

    // Get statistics
    getStats: () => api.get('/api/stats')
};

// Form validation helpers
const validation = {
    // Check if string is not empty
    required: (value) => {
        return value && value.trim().length > 0;
    },

    // Check if string meets minimum length
    minLength: (value, min) => {
        return value && value.trim().length >= min;
    },

    // Check if string doesn't exceed maximum length
    maxLength: (value, max) => {
        return !value || value.trim().length <= max;
    },

    // Check if value is a positive number
    positiveNumber: (value) => {
        const num = parseInt(value);
        return !isNaN(num) && num > 0;
    },

    // Check if value is within range
    range: (value, min, max) => {
        const num = parseInt(value);
        return !isNaN(num) && num >= min && num <= max;
    }
};

// Form helper functions
const formHelpers = {
    // Get form data as object
    getFormData: (form) => {
        const formData = new FormData(form);
        const data = {};

        for (let [key, value] of formData.entries()) {
            data[key] = value;
        }

        return data;
    },

    // Set form data from object
    setFormData: (form, data) => {
        Object.keys(data).forEach(key => {
            const field = form.querySelector(`[name="${key}"]`);
            if (field) {
                field.value = data[key] || '';
            }
        });
    },

    // Clear form
    clearForm: (form) => {
        form.reset();

        // Clear any validation errors
        const errorElements = form.querySelectorAll('.error');
        errorElements.forEach(element => element.remove());

        // Remove error classes
        const errorFields = form.querySelectorAll('.error-field');
        errorFields.forEach(field => field.classList.remove('error-field'));
    },

    // Show field error
    showFieldError: (field, message) => {
        // Remove existing error
        const existingError = field.parentNode.querySelector('.error');
        if (existingError) {
            existingError.remove();
        }

        // Add error class to field
        field.classList.add('error-field');

        // Create error element
        const errorElement = document.createElement('div');
        errorElement.className = 'error';
        errorElement.textContent = message;
        errorElement.style.color = '#f56565';
        errorElement.style.fontSize = '0.875rem';
        errorElement.style.marginTop = '0.25rem';

        // Insert error after field
        field.parentNode.insertBefore(errorElement, field.nextSibling);
    },

    // Clear field error
    clearFieldError: (field) => {
        field.classList.remove('error-field');
        const error = field.parentNode.querySelector('.error');
        if (error) {
            error.remove();
        }
    }
};

// Animation helpers
const animations = {
    // Fade in element
    fadeIn: (element, duration = 300) => {
        element.style.opacity = '0';
        element.style.display = 'block';

        let start = null;
        const animate = (timestamp) => {
            if (!start) start = timestamp;
            const progress = timestamp - start;

            element.style.opacity = Math.min(progress / duration, 1);

            if (progress < duration) {
                requestAnimationFrame(animate);
            }
        };

        requestAnimationFrame(animate);
    },

    // Fade out element
    fadeOut: (element, duration = 300) => {
        let start = null;
        const animate = (timestamp) => {
            if (!start) start = timestamp;
            const progress = timestamp - start;

