func (app *App) calculateCurrentStreak(habitID int) int {
	rows, err := app.DB.Query(`
		SELECT DATE(completed_at) as completion_date
		FROM habit_completions 
		WHERE habit_id = ? 
		GROUP BY DATE(completed_at)
		ORDER BY completion_date DESC
	`, habitID)
	if err != nil {
		return 0
	}
	defer rows.Close()

	streak := 0
	expectedDate := time.Now().Format("2006-01-02")

	for rows.Next() {
		var completionDate string
		rows.Scan(&completionDate)

		if completionDate == expectedDate {
			streak++
			// Move to previous day
			date, _ := time.Parse("2006-01-02", expectedDate)
			expectedDate = date.AddDate(0, 0, -1).Format("2006-01-02")
		} else {
			break
		}
	}

	return streak
}

func (app *App) calculateLongestStreak(habitID int) int {
	rows, err := app.DB.Query(`
		SELECT DATE(completed_at) as completion_date
		FROM habit_completions 
		WHERE habit_id = ? 
		GROUP BY DATE(completed_at)
		ORDER BY completion_date ASC
	`, habitID)
	if err != nil {
		return 0
	}
	defer rows.Close()

	maxStreak := 0
	currentStreak := 0
	var lastDate time.Time

	for rows.Next() {
		var completionDate string
		rows.Scan(&completionDate)

		date, _ := time.Parse("2006-01-02", completionDate)

		if lastDate.IsZero() || date.Sub(lastDate).Hours() == 24 {
			currentStreak++
		} else {
			if currentStreak > maxStreak {
				maxStreak = currentStreak
			}
			currentStreak = 1
		}

		lastDate = date
	}

	if currentStreak > maxStreak {
		maxStreak = currentStreak
	}

	return maxStreak
}


