type Habit struct {
	ID              int       `json:"id"`
	Name            string    `json:"name"`
	Description     string    `json:"description"`
	WeeklyFrequency int       `json:"weekly_frequency"`
	Category        string    `json:"category"`
	CreatedAt       time.Time `json:"created_at"`
	IsActive        bool      `json:"is_active"`
}

type HabitCompletion struct {
	ID          int       `json:"id"`
	HabitID     int       `json:"habit_id"`
	CompletedAt time.Time `json:"completed_at"`
	Notes       string    `json:"notes"`
}

type HabitStats struct {
	Habit           Habit `json:"habit"`
	CurrentStreak   int   `json:"current_streak"`
	LongestStreak   int   `json:"longest_streak"`
	WeeklyProgress  int   `json:"weekly_progress"`
	TotalCompleted  int   `json:"total_completed"`
}

type App struct {
	DB *sql.DB
}

func main() {
	app := &App{}

	// Initialize database
	var err error
	app.DB, err = sql.Open("sqlite3", "./habits.db")
	if err != nil {
		log.Fatal(err)
	}
	defer app.DB.Close()

	// Create tables
	app.createTables()

	// Setup routes
	r := mux.NewRouter()

	// Web UI routes
	r.HandleFunc("/", app.homeHandler).Methods("GET")
	r.HandleFunc("/habits", app.habitsPageHandler).Methods("GET")
	r.HandleFunc("/stats", app.statsPageHandler).Methods("GET")

	// API routes
	r.HandleFunc("/api/habits", app.getHabitsHandler).Methods("GET")
	r.HandleFunc("/api/habits", app.createHabitHandler).Methods("POST")
	r.HandleFunc("/api/habits/{id}", app.updateHabitHandler).Methods("PUT")
	r.HandleFunc("/api/habits/{id}", app.deleteHabitHandler).Methods("DELETE")
	r.HandleFunc("/api/habits/{id}/complete", app.completeHabitHandler).Methods("POST")
	r.HandleFunc("/api/habits/{id}/completions", app.getCompletionsHandler).Methods("GET")
	r.HandleFunc("/api/stats", app.getStatsHandler).Methods("GET")

	// Static files
	r.PathPrefix("/static/").Handler(http.StripPrefix("/static/", http.FileServer(http.Dir("./static/"))))

	fmt.Println("Server starting on :8080")
	log.Fatal(http.ListenAndServe(":8080", r))
}

func (app *App) createTables() {
	habitsTable := `
	CREATE TABLE IF NOT EXISTS habits (
		id INTEGER PRIMARY KEY AUTOINCREMENT,
		name TEXT NOT NULL,
		description TEXT,
		weekly_frequency INTEGER NOT NULL DEFAULT 1,
		category TEXT DEFAULT 'General',
		created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
		is_active BOOLEAN DEFAULT 1
	);`

	completionsTable := `
	CREATE TABLE IF NOT EXISTS habit_completions (
		id INTEGER PRIMARY KEY AUTOINCREMENT,
		habit_id INTEGER NOT NULL,
		completed_at DATETIME DEFAULT CURRENT_TIMESTAMP,
		notes TEXT,
		FOREIGN KEY (habit_id) REFERENCES habits (id)
	);`

	_, err := app.DB.Exec(habitsTable)
	if err != nil {
		log.Fatal(err)
	}

	_, err = app.DB.Exec(completionsTable)
	if err != nil {
		log.Fatal(err)
	}
}

